import React from "react";
import { Link } from "react-router-dom";
const Nav=()=>{
    return(
        <div >
            <ul className="links">

            <li></li><Link to="/">Home</Link><li></li>
            <li></li><Link to="/profile">Profile</Link><li></li>
            <li></li><Link to="/add">Add Product</Link><li></li>
            <li></li><Link to="/remove">Remove Product</Link><li></li>
            <li></li><Link to="/contact">Contact</Link><li></li>
            </ul>
        </div>
    )
}

export default Nav
